class Solution(object):
    def isValid(self, s):
        """
        :type s: str
        :rtype: bool
        """

        stack = []
        for i in s:
            if i == '(':
                stack.append('(')
            elif i == ')':
                if stack and stack[-1] == '(':
                    stack.pop()
                else:
                    return False
            elif i == '{':
                stack.append('{')
            elif i == '}':
                if stack and stack[-1] == '{':
                    stack.pop()
                else:
                    return False
            elif i == '[':
                stack.append('[')
            elif i == ']':
                if stack and stack[-1] == '[':
                    stack.pop()
                else:
                    return False
        return len(stack) == 0

