class Solution(object):
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: int
        """

        # 1. count the frequency of each letter
        # 2. if the frequency is odd, add 1 to the result
        # 3. if the frequency is even, add it to the result
        # 4. return the result

        freq = {}
        for letter in s:
            if letter in freq:
                freq[letter] += 1
            else:
                freq[letter] = 1

        result = 0
        for letter in freq:
            if freq[letter] % 2 == 0:
                result += freq[letter]
            else:
                result += freq[letter] - 1

        if result < len(s):
            result += 1

        return result

