class Solution(object):
    def reversePairs(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        def merge(nums, left, mid, right):
            i, j = left, mid
            res = 0
            while i < mid and j < right:
                if nums[i] > 2 * nums[j]:
                    res += mid - i
                    j += 1
                else:
                    i += 1
            nums[left:right] = sorted(nums[left:right])
            return res

        def mergeSort(nums, left, right):
            if left + 1 >= right:
                return 0
            mid = (left + right) // 2
            res = mergeSort(nums, left, mid) + mergeSort(nums, mid, right)
