        :type board: List[List[str]]
        :rtype: None Do not return anything, modify board in-place instead.
        """

        def solve(board):
            # Find an empty square
            for i in range(9):
                for j in range(9):
                    if board[i][j] == '.':
                        # Try filling in the square with a number
                        for k in range(1, 10):
                            if isValid(board, i, j, k):
