                                    return True
                                # If the square is invalid, backtrack and try a different number
                                board[i][j] = '.'
                        return False
            # If there are no more empty squares, the board is solved
            return True

        def isValid(board, i, j, k):
            # Check if the number k is valid in the row i
            for l in range(9):
                if board[i][l] == str(k):
                    return False
            # Check if the number k is valid in the column j
            for l in range(9):
                if board[l][j] == str(k):
                    return False
            # Check if the number k is valid in the 3x3 square containing the square (i, j)
            start_i = i // 3 * 3
