        :type n: int
        :rtype: int
        """

        def isValid(board, row, col):
            for i in range(row):
                if board[i][col] == 'Q':
                    return False
            i, j = row, col
            while i >= 0 and j >= 0:
                if board[i][j] == 'Q':
                    return False
                i -= 1
                j -= 1
            i, j = row, col
            while i < n and j >= 0:
                if board[i][j] == 'Q':
                    return False
                i += 1
                j -= 1
            return True

        def backtrack(board, row):
            if row == n:
                return 1
            count = 0
            for col in range(n):
                if isValid(board, row, col):
                    board[row][col] = 'Q'
                    count += backtrack(board, row + 1)
                    board[row][col] = '.'
            return count

        board = [['.' for _ in range(n)] for _ in range(n)]
        return backtrack(board, 0)

